    "preliminary-investigations-in-stillwater-marsh-human-prehistory-and-geoarchaeology-volume-",nt"isopen":
    false,nt"url": null,nt"notes": "Between 1982 and 1986, winter precipitation
    in the northern Great Basin hit record levels, resulting in severe flooding in the
    Carson Desert. As the waters receded, erosion in about 80 square km of the Stillwater
    Marsh exposed hundreds of prehistoric burials, caches, trash pits, and houses that
    contain a wealth of well-preserved faunal, floral, artifactual, and human remains.
    The following brief review of the archaeology of the Carson Desert and vicinity
    demonstrates the importance of these sites for understanding the prehistory of the
    western Great Basin, as well as their utility in informing us about larger issues
    of hunter-gatherer cultural ecology.",nt"license_title": "License Not Specified",nt"extras":
